    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN ( col0 * ( + col2 ) - + col2 + - + CAST ( - col0 AS INTEGER ) ) AND NULL;
  - name: tab2

outputs:
  - name: q2659.out
    data: |
